import React from 'react';
import {NavLink} from "react-router-dom";
import styles from './HeaderNav.module.scss'

const List = styled.li`
  
`
const ListItem = styled.li`
  list-style: none;
  display: inline-block;
  margin-right: 50px;
  max-width: 120px;
  &Link {
    text-decoration: none;
    color: #818181;
    &Active {
      font-weight: 700;
    }
  };

`


const HeaderNav = () => (
    <nav>
        
    </nav>
);

export default HeaderNav;

<nav>
    <ul className={styles.wrapper}>
        <li className={styles.navItem}><NavLink exact activeClassName={styles.navItemLinkActive}
                                                className={styles.navItemLink} to="/">start</NavLink></li>
        <li className={styles.navItem}><NavLink activeClassName={styles.navItemLinkActive}
                                                className={styles.navItemLink} to="/edit">edytuj</NavLink></li>
        <li className={styles.navItem}><NavLink activeClassName={styles.navItemLinkActive}
                                                className={styles.navItemLink} to="/add">dodaj</NavLink></li>
        <li className={styles.navItem}><NavLink activeClassName={styles.navItemLinkActive}
                                                className={styles.navItemLink} to="/list">lista</NavLink></li>
        <li className={styles.navItem}><NavLink activeClassName={styles.navItemLinkActive}
                                                className={styles.navItemLink} to="/settings">ustawienia</NavLink></li>
    </ul>
</nav>
